<p>“哥，<a href="https://javabetter.cn/array/array.html" target="_blank" rel="noopener noreferrer">之前听你说，数组也是一个对象</a>，但 Java 中并未明确的定义这样一个类。”看来三妹有在用心地学习。</p>
<p>“是的，因此数组也就没有机会覆盖 <code>Object.toString()</code> 方法。如果尝试直接打印数组的话，输出的结果并不是我们预期的结果。”我接着三妹的话继续说。</p>
<p>“那怎么打印数组呢？”三妹心有灵犀地把今天的核心问题提了出来。</p>
