<p>讲真，Stack 这个类在 Java 应用中并不常用，但栈这个数据结构在整个计算机体系中却十分重要。所以我们还是放到<a href="https://javabetter.cn/collection/gailan.html" target="_blank" rel="noopener noreferrer">集合框架</a>里来讲一讲。</p>
