<p>“三妹，通过前面两篇，我们已经深入地了解了 Java <a href="https://javabetter.cn/oo/abstract.html" target="_blank" rel="noopener noreferrer">抽象类</a>和 Java <a href="https://javabetter.cn/oo/interface.html" target="_blank" rel="noopener noreferrer">接口</a>，那这篇我们来重点说一下抽象类和接口之间的区别。”我放下手中的鼠标和键盘，转向右手边，对三妹说。</p>
